  \"2014-10-30T16:44:28.958519\",\n\t\"name\": \"research-education-and-economics-information-system-reeis\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Research, Education, and Economics Information
  System (REEIS) is a source of information on the research, education and extension
  programs, projects and activities of the U. S. Department of Agriculture (USDA)
  National Institute of Food and Agriculture (NIFA), the USDA Forest Service, the
  USDA National Agricultural Statistics Service, the U. S. Patent and Trademark Office,
  U. S. Census Bureau, and the U. S. National Science Foundation. The system enables
  users to measure the impact and effectiveness of research, extension and education
  programs based on data related to agricultural research; forestry research; students,
  faculty and degrees related to agriculture; USDA partner institution snapshots;
  Food and nutrition research; 4-H programs; and agricultural snapshots of each state.
  Internet links to related agencies, institutions, and data bases are also included.\",\n\t\"license_title\":
